import React from 'react';


const Navbar = () => {
    return (
        <>
            <nav className='bg-cyan-500 h-14'>
                <ul className='flex space-x-5 justify-end px-4 py-4 '>

                    <li>Home</li>
                    <li>Movies/Shows</li>
                    <li>Subscription</li>
                    <li>Profile</li>
                </ul>
            </nav>
        </>
    )
}

export default Navbar
